query FavoriteArtworksQuery {
  me {
    ...Artworks_me
    __id
  }
}

fragment Artworks_me on Me {
  saved_artworks {
    artworks_connection(private: true, first: 10, after: "") {
      pageInfo {
        endCursor
        hasNextPage
      }
      edges {
        node {
          ...GenericGrid_artworks
          __id
          __typename
        }
        cursor
      }
    }
    __id
  }
  __id
}

fragment GenericGrid_artworks on Artwork {
  __id
  id
  image {
    aspect_ratio
  }
  ...Artwork_artwork
}

fragment Artwork_artwork on Artwork {
  title
  date
  sale_message
  is_in_auction
  id
  sale_artwork {
    opening_bid {
      display
    }
    current_bid {
      display
    }
    bidder_positions_count
    sale {
      is_closed
      __id
    }
    __id
  }
  image {
    url(version: "large")
    aspect_ratio
  }
  artists(shallow: true) {
    name
    __id
  }
  partner {
    name
    __id
  }
  href
  __id
}
